import React, { Component } from 'react'
import All from '../Styles/All.css'
import { FaBars } from "react-icons/fa";
class Main extends Component
{
     
    state = {clicked:false};
    handleClickbar=()=>
    {
      this.setState(
        {
            clicked:!this.state.clicked
        }
      )  
    }
    render()
    {
        return(
            <div className='outertag'>
                <div className='navbar1'>
                    <div className='brandn'>Nadeem's<span>folio</span></div>
                    <ul id='menuitems' className={this.state.clicked ? "#menuitems active" : "#menuitems" }>
                        <li ><a className='item'  >Skills</a></li>
                        <li ><a className='item' > Projects</a></li>
                        <li ><a className='item' >Contact me</a></li>
                    </ul>
                    <div id='mobile' onClick={this.handleClickbar}>
                        <i id= "bar" className={this.state.clicked ? (<FaBars/> ): (<FaBars/>)}><FaBars/></i>
                    </div>
                </div>
            </div>
        )
    }
    
}
export default Main;
